			return False
		if 'Comment' in title:
			return False
		if ':' in title:
			postfix = title.split(':', 1)[-1].strip()
		elif '-' in title:
			postfix = title.split('–', 1)[-1].strip()
		else:
			postfix = ''
		return buildReleaseMessage(item, 'Konjiki no Wordmaster', vol, chp, frag=frag, postfix=postfix)
